import React from 'react';

const List = ({list}) => {

    return (
        <div>
            <h3>Lista</h3>
            <ol>
                {
                list.map(item =>{
                    <li>
                        item
                    </li>
                })    
                }
            </ol>
        </div>
    )
}

export default List;
